// App.js
import React, { useEffect, useState } from "react";

const App = () => {
  const [resourceData, setResourceData] = useState(null);

  useEffect(() => {
    // Replace 'your-jwt-token' with the actual JWT token you have
    const jwtToken =
"eyJhbGciOiJSUzI1NiIsInR5cCIgOiAiSldUIiwia2lkIiA6ICJ6R0RyQzRKcWptcWU1YTAxUEtBZXBNaURYMVZBMWl2TDRnWmg3b2l3QlhnIn0..EAXTR6XijKkIKtL25cC72JD6-ppDZbQiRsqUurIZF_OjnnFv-UmJgCrawsnacKolWzTwacUb4agwusJhzNDspzsJrMj0np-0CU7q9SzU5l5KjswPtBw75hJvFRy5IYMdClhryKAUF5lschInIs2CoE9MbtATNH31qUTGUw2M31ylag7ORvgPZU0LZS31x8ezKO1mnK7BB3vf-d_hKHdKbtrEzVlBsf6q_OobrsZ298ctwFKZPKLLlOZsqGFm6ewQCRTrg7rv-tuXfNHkhFdktG43DVWv2aHm09IhG7O4wYa2tB-THilGmyzB92Ha-gZnc2g5fXmJVfO6tahHzOzIog";      
    // URL of your Go service's protected resource
    const url = "http://localhost:8000/api/resource";

    // Make the API request with the JWT token in the Authorization header
    fetch(url, {
      method: "GET",
      headers: {
        Authorization: `Bearer ${jwtToken}`,
      },
    })
      .then((response) => {
        if (!response.ok) {
          throw new Error("Network response was not ok");
        }
        return response.json();
      })
      .then((data) => {
        console.log("Received resource data:", data);
        setResourceData(data);
      })
      .catch((error) => {
        console.error("Error fetching data:", error);
      });
  }, []);

  return (
    <div>
      <h1>Hello, world!</h1>
      <p>Resource Data: {resourceData ? JSON.stringify(resourceData) : "Loading..."}</p>
    </div>
  );
};

export default App;
